import React from 'react';
import {Input, Row, Col} from 'reactstrap';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Row>
        <Col className="bg-light border">
          <Input className='link'
            bsSize="lg"
          />
        </Col>
      </Row>

      </header>
    </div>
  );
}

export default App;
